    false,nt"url": null,nt"notes": "NCEI Accession 0144245 includes chemical,
    meteorological, physical and time series data collected from MOORING CCE1_122W_33N
    and MOORING_CCE1_122W_33N in the North Pacific Ocean from 2008-11-11 to 2014-10-26.
    These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON
    DIOXIDE, BAROMETRIC PRESSURE, OXYGEN - PERCENT SATURATION, Partial pressure (or
    fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon
    dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
    these data include Bubble type equilibrator for autonomous carbon dioxide (CO2)
    measurement, Carbon dioxide (CO2) gas analyzer, Humidity Sensor, oxygen meter and
    thermosalinographs.nnThese data were collected by Adrienne Sutton, Christopher Sabine,
    Sylvia Musielewicz and Stacy Maenner of US DOC; NOAA; OAR; Pacific Marine Environmental
    Laboratory and Uwe Send and Mark Ohman of University of California - San Diego;
    Scripps Institution of Oceanography as part of the Mooring CCE1_122W_33N, Mooring_CCE1_122W_33N_Mar2011_Sep2012
    and Mooring_CCE1_122W_33N_Sep2013_Oct2014 data set. CDIAC associated the following
    cruise ID(s) with this data set: CCE120081111, CCE120110307 and CCE120130930nnThe
    Global CO2 Time-series and Moorings Project involves international groups from 18
    countries who have mounted sensors on moored buoys to provide high resolution time-series
    measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
    (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
